<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Happy Birthday!</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
            background-color: #f0f0f0;
        }
        .container {
            text-align: center;
        }
        h1 {
            color: #ff4081;
            font-size: 3em;
            margin-bottom: 20px;
        }
        .cake {
            width: 300px;
            cursor: pointer;
            transition: transform 0.3s ease;
        }
        .cake:hover {
            transform: scale(1.1);
        }
        .confetti {
            position: absolute;
            width: 10px;
            height: 10px;
            background-color: #ff4081;
            opacity: 0;
        }
    </style>
</head>
<body>
    <div class="container">
        <h1>Happy Birthday <?php 
            $events = [
                '29-09' => 'John',
            ];
            $currentDate = date('d-m');
            if (array_key_exists($currentDate, $events)) {
                echo $events[$currentDate] . " ";
            }
        ?>!</h1>
        <script>
            const urlParams = new URLSearchParams(window.location.search);
            const name = urlParams.get('name');
            if (name) {
                const h1Element = document.querySelector('h1');
                const h1Text = h1Element.innerText;
                const words = h1Text.split(' ');
                const modifiedText = words.slice(0, 2).join(' ') + ' ' + name + ' !';
                h1Element.textContent = modifiedText;
            }
        </script>
        <img src="data:image/webp;base64," alt="Birthday Cake" class="cake" id="cake">
        <img src="data:image/webp;base64," alt="Birthday Cake" class="cake" id="cake2">
    </div>

    <script>
        function getRandomIntInclusive(min, max) {
            min = Math.ceil(min);
            max = Math.floor(max);
            return Math.floor(Math.random() * (max - min + 1)) + min;
        }

        const position = getRandomIntInclusive(0, 1);
        const cakes = [document.getElementById('cake'), document.getElementById('cake2')];
        const cake = cakes[position];
        const bad_cake = cakes[position ? 0 : 1];
        const container = document.querySelector('.container');

        bad_cake.style.display = "none";

        function createConfetti() {
            const confetti = document.createElement('div');
            confetti.classList.add('confetti');
            confetti.style.left = Math.random() * window.innerWidth + 'px';
            confetti.style.top = '-10px';
            confetti.style.backgroundColor = `hsl(${Math.random() * 360}, 100%, 50%)`;
            container.appendChild(confetti);

            let animation = confetti.animate([
                { transform: 'translateY(0) rotate(0deg)', opacity: 1 },
                { transform: `translateY(${window.innerHeight}px) rotate(${Math.random() * 360}deg)`, opacity: 0 }
            ], {
                duration: Math.random() * 3000 + 2000,
                easing: 'cubic-bezier(0.25, 0.46, 0.45, 0.94)'
            });

            animation.onfinish = () => confetti.remove();
        }

        cake.addEventListener('click', () => {
            for (let i = 0; i < 50; i++) {
                setTimeout(createConfetti, i * 50);
            }
        });

        for (let i = 0; i < 150; i++) {
            setTimeout(createConfetti, i * 50);
        }
    </script>
</body>
</html>
